import React,{ Component } from "react";
import axios from 'axios';



export default class Contact extends Component{
      constructor(props){
        super(props);


        this.state = {
          title : ''
        }
      }





      componentDidMount = async() =>{
        var FormData = require('form-data');
        var data = new FormData();
        data.append('contact_form', true);
        data.append('title', title);
        data.append('content', content);
        data.append('meta[1]', email);

        var config = {
          method: 'post',
          url: 'http://localhost/my-app1/',
          headers: { 
            'Cookie': 'PHPSESSID=d2bq9ovjnguhmmkh0kgum7cvv6', 
            ...data.getHeaders()
          },
          data : data
        };

        axios(config)
      }
    render(){
        return(

          
            <section class="contact_area full_w">
            <div class="contact_content full_w">
              <div class="center">
              <div class="forms">
                <div class="forms_text">
                  <h2>Send us a message</h2>
                  <p>Feel free to fill out the form and reach to us.<br/>
                      We will get back to you shortly.</p>
                </div>
        
                <form>
                  <div class="input-row">
                    <div class="input-group">
                      <input type="text" name="" placeholder="First Name" />
                    </div>
                     <div class="input-group">
                      <input type="text" name="" placeholder="Last Name" />
                    </div>
                    
                  </div>
                    <div class="input-row">
                    <div class="input-group">
                      <input type="email" name="" placeholder="Email Address" />
                    </div>
                     <div class="input-group">
                      <input type="text" name="" placeholder="Phone" />
                    </div>
                    
                  </div>
        
                  <div class="input-row">
                    <textarea placeholder="Message"></textarea>
                    
                  </div>
                    
                 <div class="input-row btn-sub">
                   <input type="submit" name="" value="Submit"  class="button" />
                 </div>
                </form>
                
              </div>
              
            </div>
         </div>
            </section>
         
         
        );
    }
}
